import * as types from "./../Constant/ActionTypes";

var inititalState = [];

const exploreSlides = (state = inititalState, action) => {
  switch (action.type) {
    case types.EXPLORE_SLIDES:
      return [...state];
    default:
      return [...state];
  }
};
export default exploreSlides;
